import { TestBed } from '@angular/core/testing';
import { employeeFormComponent } from './employeeForm.component';
describe('employeeFormComponent', () => {
    let component;
    let fixture;
    beforeEach(async () => {
        await TestBed.configureTestingModule({
            declarations: [employeeFormComponent]
        })
            .compileComponents();
    });
    beforeEach(() => {
        fixture = TestBed.createComponent(employeeFormComponent);
        component = fixture.componentInstance;
        fixture.detectChanges();
    });
    it('should create', () => {
        expect(component).toBeTruthy();
    });
    fit('should delete an employee data', () => {
        fixture = TestBed.createComponent(employeeFormComponent);
        component = fixture.componentInstance;
        component.myLocalArray = [
            {
                name: "Muhammad Awais",
                phone: "03213333853",
                address: "Lahore",
                id: "aasdasdasd54ssasds",
                picture: "https://images.com"
            },
            {
                name: "Muhammad Afaq",
                phone: "112233",
                address: "USA",
                id: "aasdasdasks4ssasds",
                picture: "https://images1.com"
            },
            {
                name: "Umair Ijaz",
                phone: "454545",
                address: "Dajal",
                id: "aasdasdayskissasds",
                picture: "https://images2.com"
            }
        ];
        component.deleted = [
            {
                name: "Muhammad Afaq",
                phone: "112233",
                address: "USA",
                id: "aasdasdasks4ssasds",
                picture: "https://images1.com"
            },
            {
                name: "Umair Ijaz",
                phone: "454545",
                address: "Dajal",
                id: "aasdasdayskissasds",
                picture: "https://images2.com"
            }
        ];
        component.deleteEmployee(1);
        expect(component.myLocalArray).toEqual(component.deleted);
    });
});
